            <span>ãƒ»</span>
            <FontAwesomeIcon icon={faGear} className='fa-sm' />
            <a>Monitor</a>
            </div>
        </div>
    )
}

const IconItem = () => {
    const icons = [
        {id: 1, iconexample: "faGear" },
