    ]
    return (
        <>
        {icons.map((icon) => <SideBarItem key={icon.id} icon={icon.iconexample} />)}
        </>
    )
}

class SideBar extends React.Component {
    render() {
         return(
             <div className="sidebar-wrapper">
                 <SideBarTitle />
                 <div className="sidebar-item-wrapper"> 
                     <SideBarItem />
                     <SideBarItem />
                 </div>

             </div>

         );
    }
}

export default SideBar;
